// import withLayout from "../components/MyLayout";

// const Page = () => <p>This is the about page</p>;

// export default withLayout(Page);

import React, { Component } from "react";
import useSWR from "swr";

export default function FetchData() {
  const fetcher = (url) => fetch(url).then((res) => res.json);
  const { data, error } = useSWR("/api/entry_level_api", fetcher);

  if (error) return <div>Failed to load entry level api</div>;
  if (!data) return <div>Loading...</div>;

  return this.data.entry_level.map(res, (index) => {
    const { job_position, company, location, url } = res;
    return (
      <article className="job-card" key={index}>
        <h1>{job_position}</h1>
        <h2>{company}</h2>
        <h2>{location}</h2>
        <h2>{url}</h2>
      </article>
    );
  });
}
